import React from 'react';
import './styles.css'

export function GetMockData({select}) {
    return (
        <div>
            <h3>{ select.index }</h3>
            <h2>{ select.name }</h2>
            <p>{ select.food }</p>
            <p>{ select.products.length }</p>
        </div>


    );
}

export default GetMockData;
